import React, {useEffect, useState} from "react";
import "../../../src/css/header.css"

export default function Order() {
    const [order, setOrders] = useState([]);

    const orders = () => {
        fetch("/order/get")
            .then(orders => orders.json())
            .then(orders => setOrders(orders))
    }

    useEffect(() => {
        orders()
    })

    return (
        <>
            <div className="order">
                <table>
                    <tr>
                        <th>ID</th>
                        <th>NAME</th>
                        <th>PHONE</th>
                    </tr>

                </table>
                {
                    order.map((o) => (
                        <tr>
                            <td>{o.id}</td>
                            <td>{o.name}</td>
                            <td>{o.numberPhone}</td>
                        </tr>
                    ))
                }
            </div>
        </>
    )
}
